import React from "react";
import { BrowserRouter as Router, Route, Redirect } from "react-router-dom";
import Users from "./user/pages/Users";
import NewPlace from "./places/pages/NewPlaces";
const App = () => {
  return (
    <div className="App">
      <Router>
        <Route path="/" exact>
          <Users />
        </Route>
        <Route path="/places/new" exact>
          <NewPlace />
        </Route>
        <Redirect to="/"/>
      </Router>
    </div>
  );
};

export default App;
